let generateArray = (repoSummary, username) => {
  let DATAf = [];
  let DATAd = [];
  
  repoSummary.forEach(item => {
    let { repo, Start, Finish, Exclude, d } = item;
    let excludedSet = new Set(Exclude);
    
    // Generate range dynamically and exclude missing files
    let range = Array.from({ length: Finish - Start + 1 }, (_, i) => Start + i).filter(num => !excludedSet.has(num));
    
    // Categorize files based on repository-level IsDATAd flag
    range.forEach(num => {
      let url = `https://raw.githubusercontent.com/${username}/${repo}/master/${num}.jpg`;
      if (d!=undefined) {
        DATAd.push(url);
      } else {
        DATAf.push(url);
      }
    });
  });

  return { DATAf, DATAd, DATA: DATAd.concat(DATAf) };
};

// Generate arrays at runtime
